import React from 'react';

function Home() {
  return (
    <div className="container mx-auto p-6">
      <h1 className="text-4xl font-bold text-center">Welcome to Becof Organic Chemicals</h1>
      <p className="text-center mt-4">Discover eco-friendly solutions for your agricultural needs.</p>
    </div>
  );
}

export default Home;
